import { useState } from "react";
import fondo from "./images/fondo_login.jpg"

function Login() {
  const [isRegister, setIsRegister] = useState(false);

  return (
    <div className="flex min-h-screen">

        {/* Columna Izquierda */}
        <div className="hidden md:flex w-1/2 bg-gradient-to-r from-color7 to-color6 items-center justify-center p-10">
            <div className="text-center text-white space-y-6">
                <h1 className="text-4xl font-bold">Bienvenido a InterSkill </h1>
                <p className="text-lg max-w-md mx-auto">
                    Somos una comunidad donde buscamos aprender lo que soñamos a travez de las cosas que sabemos hacer. ¿Tienes algo en lo que eres bueno? Compartelo. 
                </p>
                <img 
                    src={fondo} 
                    alt="Fondo Login" 
                    className="max-w-sm mx-auto"
                />
            </div>
        </div> 
        {/* Columna derecha con el login */}
        
    </div>
  );
}

export default Login;
